    "2015-09-26T20:43:52.193191",nt"name": "undersea-feature-place-names-as-of-june-2014",nt"isopen":
    false,nt"url": null,nt"notes": "There are approximately 5100 undersea features
    with names approved by the United States Board on Geographic Names (BGN) currently
    in the Geographic Names Data Base (GNDB) and made available via the GEOnet Names
    Server (GNS). The BGN approves undersea feature names based on the recommendation
    of the Advisory Committee on Undersea Features (ACUF). ACUF is charged with recommending
    BGN policy for totally-submerged undersea features which lie outside the territorial
    sea (as recognized by the United Nations Convention on the Law of the Sea) of all
    coastal states. Undersea features within the territorial sea of the United States
    are handled by the BGN Domestic Names Committee (DNC) in coordination with ACUF.
    Toponymic information is based on the Geographic Names Database, containing official
    standard names approved by the United States Board on Geographic Names and maintained
    by the National Geospatial-Intelligence Agency. More information is available at
    the Products and Services link at www.nga.mil. The National Geospatial-Intelligence
    Agency name, initials, and seal are protected by 10 United States Code Section 425.",nt"license_title":
